import * as React from 'react';
import {
  Grid,
  Typography,
  Card,
  CardHeader,
  CardContent,
  Divider,
  Button,
} from '@material-ui/core';
import useTranslations from '../../hooks/useTranslations';
import useStyles from './style';

const PropertyCard: React.FunctionComponent = () => {
  const { t } = useTranslations();
  return (
    <Grid item xs={12} sm={6}>
      <Card>
        <CardHeader title="Gebäude 1" />
        <Divider />
        <CardContent>
          <Button>{t('view-rooms')}</Button>
          <Button>{t('edit')}</Button>
          <Button>{t('delete')}</Button>
        </CardContent>
      </Card>
    </Grid>
  );
};

const Property: React.FunctionComponent = () => {
  const classes = useStyles();
  const { t } = useTranslations();
  return (
    <div className={classes.root}>
      <Grid container spacing={4}>
        <Grid item xs={12} sm={6}>
          <Typography variant="body1">{t('administration')}</Typography>
          <Typography variant="h6">Gebäude & Räume</Typography>
        </Grid>
      </Grid>
      <Grid container spacing={4}>
        <Grid item xs={12} sm={6}>
          <Grid container spacing={1}>
            <PropertyCard />
            <PropertyCard />
            <PropertyCard />
          </Grid>
        </Grid>
      </Grid>
    </div>
  );
};

export default Property;
